					["Hooks"] = {
						["Nameplate Added"] = "function (self, unitId, unitFrame, envTable, modTable)\n    --check if need update the amount of combo points shown\n    if (modTable.LastPlayerTalentUpdate > envTable.LastUpdate) then\n        envTable.UpdateRessourcesAmount(unitFrame)\n    end    \n    \n    if envTable.shouldShowForSpec and (unitFrame.namePlateIsTarget and not unitFrame.IsSelf and (not envTable.onEnemyOnly or (envTable.onEnemyOnly and unitFrame.namePlateUnitReaction <= 4 )) and (not envTable.checkForm or (envTable.checkForm and GetShapeshiftForm() == 2))) then\n        unitFrame.personalResourceFrame:Show()\n        envTable.UpdatepersonalResource(unitFrame)\n    else\n        unitFrame.personalResourceFrame:Hide()\n    end\nend\n\n\n",
						["Target Changed"] = "function (self, unitId, unitFrame, envTable, modTable)\n    --check if this nameplate is the current target\n    if envTable.shouldShowForSpec and (unitFrame.namePlateIsTarget and not unitFrame.IsSelf and (not envTable.onEnemyOnly or (envTable.onEnemyOnly and unitFrame.namePlateUnitReaction <= 4 )) and (not envTable.checkForm or (envTable.checkForm and GetShapeshiftForm() == 2))) then\n        unitFrame.personalResourceFrame:Show()\n        envTable.UpdatepersonalResource(unitFrame)\n    else\n        unitFrame.personalResourceFrame:Hide()\n    end\nend\n\n\n\n\n\n\n\n\n",
						["Player Power Update"] = "function (self, unitId, unitFrame, envTable, modTable)\n    --check if this nameplate is the current target\n    if envTable.shouldShowForSpec and  (unitFrame.namePlateIsTarget and not unitFrame.IsSelf and (not envTable.onEnemyOnly or (envTable.onEnemyOnly and unitFrame.namePlateUnitReaction <= 4 )) and (not envTable.checkForm or (envTable.checkForm and GetShapeshiftForm() == 2))) then\n        envTable.UpdatepersonalResource(unitFrame)\n    end\nend\n\n\n",
						["Destructor"] = "function (self, unitId, unitFrame, envTable, modTable)\n    unitFrame.personalResourceFrame:Hide()\nend\n\n\n",
						["Initialization"] = "function (modTable)\n    --save when the player changed talents or spec\n    modTable.LastPlayerTalentUpdate = GetTime()\nend",
						["Constructor"] = "function (self, unitId, unitFrame, envTable, modTable)\n    \n    -- settings --\n    envTable.onEnemyOnly = true\n    envTable.borderSize = 0 --border on the individual resource points.  0 to disable, >0 for a border that size\n    envTable.borderColor = \"black\"--\"white\"\n    envTable.inCatFormOnly = false\n    envTable.onlyAvailable = false --hide the \"empty\" background texture\n    \n    local anchors = {\n        {\"bottom\", unitFrame.healthBar, \"top\", 0, 15\n        },\n    }\n    \n    local width = 122 -- total width. single elements will be adjusted automatically\n    local height = 4\n    local scale = 1\n    \n    local frameLevel = 100\n    --local frameStrata = \"low\"\n    local frameStrata = Plater.db.profile.ui_parent_target_strata\n    \n    --local LibSharedMedia = LibStub:GetLibrary (\"LibSharedMedia-3.0\")\n    --local ressourceTexture = LibSharedMedia:Fetch (\"statusbar\", Plater.db.profile.health_statusbar_texture)\n    --local ressourceTexture = LibSharedMedia:Fetch (\"statusbar\", \"Banto Bar\")\n    --local ressourceTexture = LibSharedMedia:Fetch (\"statusbar\", \"Blizzard\")\n    local ressourceTexture = \"Interface\\\\AddOns\\\\Plater\\\\images\\\\bar_background\"\n    \n    local vertexMult = 0.35 --background color multiplier\n    \n    \n    \n    -- private --\n    \n    \n    -- sourced from FrameXML/Constants.lua\n    local SPEC_MAGE_ARCANE = SPEC_MAGE_ARCANE or 1\n    local SPEC_MONK_WINDWALKER = SPEC_MONK_WINDWALKER or 3\n    local SPEC_PALADIN_RETRIBUTION = SPEC_PALADIN_RETRIBUTION or 3\n    local SPEC_WARLOCK_DESTRUCTION = SPEC_WARLOCK_DESTRUCTION or 3\n    local SPELL_POWER_ENERGY = Enum.PowerType.Energy or 3\n    local SPELL_POWER_COMBO_POINTS = Enum.PowerType.ComboPoints or 4\n    local SPELL_POWER_SOUL_SHARDS = Enum.PowerType.SoulShards or 7\n    local SPELL_POWER_HOLY_POWER = Enum.PowerType.HolyPower or 9\n    local SPELL_POWER_CHI = Enum.PowerType.Chi or 12\n    local SPELL_POWER_ARCANE_CHARGES = Enum.PowerType.ArcaneCharges or 16\n    local SPELL_POWER_RUNES = Enum.PowerType.Runes or 5\n    \n    local _, PlayerClass = UnitClass('player')\n    local ClassPowerType, ClassPowerID, RequireSpec\n    local classColor = RAID_CLASS_COLORS[PlayerClass]\n    \n    local classResources = {\n        COMBO_POINTS = {\n            [1] = {r = 1, g = .96, b = .419},\n            [2] = {r = 1, g = .96, b = .419},\n            [3] = {r = 1, g = .96, b = .419},\n            [4] = {r = 1, g = .96, b = .419},\n            [5] = {r = 1, g = .96, b = .419},\n            [6] = {r = 1, g = .96, b = .419},\n        },\n        RUNES = { r = .31, g = .45, b = .63},\n        HOLY_POWER = { r = 228/255, g = 225/255, b = 16/255},\n        ARCANE_CHARGES = { r = 0, g = 157/255, b = 1},\n        SPELL_POWER_CHI = {\n            [1] = {r = .57, g = .63, b = .35},\n            [2] = {r = .47, g = .63, b = .35},\n            [3] = {r = .37, g = .63, b = .35},\n            [4] = {r = .27, g = .63, b = .33},\n            [5] = {r = .17, g = .63, b = .33},\n            [6] = {r = 12/255, g = 145/255, b = 58/255}\n        },\n        SOUL_SHARDS = {r = 148/255, g = 130/255, b = 201/255}\n    }\n    \n    if(PlayerClass == 'MONK') then\n        ClassPowerID = SPELL_POWER_CHI\n        ClassPowerType = 'CHI'\n        RequireSpec = SPEC_MONK_WINDWALKER\n    elseif(PlayerClass == 'PALADIN') then\n        ClassPowerID = SPELL_POWER_HOLY_POWER\n        ClassPowerType = 'HOLY_POWER'\n        --RequireSpec = SPEC_PALADIN_RETRIBUTION\n    elseif(PlayerClass == 'WARLOCK') then\n        ClassPowerID = SPELL_POWER_SOUL_SHARDS\n        ClassPowerType = 'SOUL_SHARDS'\n    elseif(PlayerClass == 'ROGUE') then\n        ClassPowerID = SPELL_POWER_COMBO_POINTS\n        ClassPowerType = 'COMBO_POINTS'\n    elseif(PlayerClass == 'DRUID') then\n        ClassPowerID = SPELL_POWER_COMBO_POINTS\n        ClassPowerType = 'COMBO_POINTS'\n        envTable.checkForm = envTable.inCatFormOnly\n    elseif(PlayerClass == 'MAGE') then\n        ClassPowerID = SPELL_POWER_ARCANE_CHARGES\n        ClassPowerType = 'ARCANE_CHARGES'\n        RequireSpec = SPEC_MAGE_ARCANE\n    elseif(PlayerClass == 'DEATHKNIGHT') then\n        ClassPowerID = SPELL_POWER_RUNES\n        ClassPowerType = 'RUNES'\n    end\n    \n    local playerMaxPower = UnitPowerMax(\"player\", ClassPowerID)\n    local playerPowerMod = UnitPowerDisplayMod(ClassPowerID)\n    --print(playerMaxPower, ClassPowerID, ClassPowerType, playerPowerMod)\n    envTable.shouldShowForSpec = not RequireSpec or RequireSpec == GetSpecialization()\n    \n    do  \n        --build combo points frame anchor (combo point are anchored to this)\n        --unitFrame.personalResourceFrame = nil\n        if (not unitFrame.personalResourceFrame) then\n            local hostFrame = CreateFrame (\"frame\", nil, unitFrame)\n            unitFrame.personalResourceFrame = hostFrame\n            \n            local resourceWidth = width / playerMaxPower - 2*(envTable.borderSize or 0)\n            --build combo point frame        \n            for i = 1, 6 do \n                local f = CreateFrame (\"StatusBar\", nil, unitFrame.personalResourceFrame)\n                f:SetSize (resourceWidth, height)\n                f:SetStatusBarTexture(ressourceTexture)\n                f:SetMinMaxValues(0, 1)\n                f:SetFrameStrata(unitFrame:GetFrameStrata())\n                f:SetFrameLevel(6)\n                unitFrame.personalResourceFrame[i] = f\n                \n                local backgroundTexture = unitFrame.personalResourceFrame:CreateTexture (nil, \"BORDER\")\n                backgroundTexture:SetSize (resourceWidth, height)\n                backgroundTexture:SetAllPoints (f)\n                backgroundTexture:SetTexture (ressourceTexture)\n                f.backgroundTexture = backgroundTexture\n                \n                local color = classResources[ClassPowerType]\n                if (color) then\n                    color = color[i] or color\n                else\n                    color = classColor\n                end\n                f:SetStatusBarColor(color.r, color.g, color.b)\n                f.backgroundTexture:SetVertexColor(color.r * vertexMult, color.g * vertexMult, color.b * vertexMult)\n                \n                if (envTable.borderSize or 0) > 0 then\n                    --local borderFrame = DetailsFramework:CreateBorderFrame (f)\n                    --borderFrame:SetBorderThickness(envTable.borderSize)\n                    --borderFrame:SetBorderColor(DetailsFramework:ParseColors(envTable.borderColor or \"white\"))\n                    \n                    local borderFrame\n                    if (DFPixelUtil) then\n                        borderFrame = CreateFrame (\"frame\", nil, f, \"PlaterNamePlateFullBorderTemplate\")\n                    else\n                        borderFrame = CreateFrame (\"frame\", nil, f, \"NamePlateFullBorderTemplate\")\n                    end\n                    \n                    borderFrame:SetBorderSizes(envTable.borderSize, envTable.borderSize, envTable.borderSize, envTable.borderSize)\n                    borderFrame:SetVertexColor(DetailsFramework:ParseColors(envTable.borderColor or \"white\"))\n                    \n                    \n                    f.border = borderFrame\n                    --borderFrame:SetFrameLevel (f:GetFrameLevel() + 1)\n                end\n                \n            end\n        end            \n        \n        unitFrame.personalResourceFrame:SetScale (scale)\n        unitFrame.personalResourceFrame:SetFrameLevel (frameLevel)\n        unitFrame.personalResourceFrame:SetFrameStrata (frameStrata)\n        \n        function envTable.UpdatepersonalResource(unitFrame)\n            if not ClassPowerID then return end\n            if not envTable.shouldShowForSpec then return end\n            if not unitFrame.personalResourceFrame:IsShown() then return end\n            local curPower = UnitPower (\"player\", ClassPowerID, true)\n            curPower = playerPowerMod == 0 and 0 or curPower / playerPowerMod\n            \n            \n            if(ClassPowerType == 'SOUL_SHARDS' and GetSpecialization() ~= SPEC_WARLOCK_DESTRUCTION) then\n                curPower = curPower - curPower % 1\n            end\n            \n            local numActive = curPower + 0.9\n            for i = 1, playerMaxPower do\n                local thisResource = unitFrame.personalResourceFrame[i]\n                \n                if (i > numActive ) then\n                    thisResource:Hide()\n                    thisResource:SetValue(0)\n                    if envTable.onlyAvailable then\n                        thisResource.backgroundTexture:Hide()\n                    end\n                else\n                    thisResource:Show()\n                    thisResource:SetValue(curPower - i + 1)\n                    thisResource.backgroundTexture:Show()\n                end\n            end\n            \n            \n        end\n        \n        function envTable.UpdateRessourcesAmount(unitFrame)\n            envTable.shouldShowForSpec = not RequireSpec or RequireSpec == GetSpecialization()\n            \n            --update anchor frame\n            unitFrame.personalResourceFrame:SetWidth (width)\n            unitFrame.personalResourceFrame:SetHeight (height)\n            unitFrame.personalResourceFrame:ClearAllPoints()\n            for i = 1, #anchors do\n                local anchor = anchors[i]\n                unitFrame.personalResourceFrame:SetPoint (unpack (anchor))\n            end        \n            \n            --\n            for i = 1, 6 do\n                --unitFrame.personalResourceFrame[i]:ClearAllPoints()\n                unitFrame.personalResourceFrame[i]:Hide()\n            end\n            \n            if not envTable.shouldShowForSpec then\n                playerMaxPower = 0\n                unitFrame.personalResourceFrame:Hide()\n                return\n            end\n            \n            playerMaxPower = UnitPowerMax (\"player\", ClassPowerID)\n            \n            local resourceWidth = width / playerMaxPower - 2*(envTable.borderSize or 0)\n            \n            for i = 1, playerMaxPower do\n                unitFrame.personalResourceFrame[i]:Show()\n                unitFrame.personalResourceFrame[i].backgroundTexture:Show()\n                unitFrame.personalResourceFrame[i]:ClearAllPoints()\n                \n                if i == 1 then\n                    unitFrame.personalResourceFrame[i]:SetSize(resourceWidth - 1, height)\n                    unitFrame.personalResourceFrame[i].backgroundTexture:SetSize(resourceWidth - 1, height)\n                    \n                    unitFrame.personalResourceFrame[i]:ClearAllPoints()\n                    unitFrame.personalResourceFrame[i]:SetPoint('LEFT', unitFrame.personalResourceFrame, 'LEFT', (2*(envTable.borderSize or 0)), 0)\n                else\n                    unitFrame.personalResourceFrame[i]:SetSize(resourceWidth - 1, height)\n                    unitFrame.personalResourceFrame[i].backgroundTexture:SetSize(resourceWidth - 1, height)\n                    \n                    unitFrame.personalResourceFrame[i]:ClearAllPoints()\n                    unitFrame.personalResourceFrame[i]:SetPoint('LEFT', unitFrame.personalResourceFrame[i - 1], 'RIGHT', 1 + (2*(envTable.borderSize or 0)), 0)\n                    \n                    if i == playerMaxPower then\n                        unitFrame.personalResourceFrame[i]:SetPoint('RIGHT', unitFrame.personalResourceFrame,  \"RIGHT\", -1, 0)\n                    end\n                end\n                \n                \n            end\n            \n            envTable.LastUpdate = GetTime()\n            \n            envTable.UpdatepersonalResource(unitFrame)\n        end\n        \n        --initialize\n        envTable.UpdateRessourcesAmount(unitFrame)\n        unitFrame.personalResourceFrame:Hide()\n    end\n    \n    envTable.LastUpdate = 0\n    \nend",
						["Nameplate Removed"] = "function (self, unitId, unitFrame, envTable, modTable)\n    unitFrame.personalResourceFrame:Hide()\nend\n\n\n",
						["Nameplate Updated"] = "function (self, unitId, unitFrame, envTable, modTable)\n    if envTable.shouldShowForSpec and (unitFrame.namePlateIsTarget and not unitFrame.IsSelf and (not envTable.onEnemyOnly or (envTable.onEnemyOnly and unitFrame.namePlateUnitReaction <= 4 )) and (not envTable.checkForm or (envTable.checkForm and GetShapeshiftForm() == 2))) then\n        unitFrame.personalResourceFrame:Show()\n        --envTable.UpdatepersonalResource(unitFrame)\n    else\n        unitFrame.personalResourceFrame:Hide()\n    end\nend\n\n\n",
						["Player Talent Update"] = "function (self, unitId, unitFrame, envTable, modTable)\n    --update the amount of ressources shown when the player changes talents or specialization\n    if (unitFrame.namePlateIsTarget and not unitFrame.IsSelf and (not envTable.onEnemyOnly or (envTable.onEnemyOnly and unitFrame.namePlateUnitReaction <= 4 )) and (not envTable.checkForm or (envTable.checkForm and GetShapeshiftForm() == 2))) then\n        unitFrame.personalResourceFrame:Show()\n    else\n        unitFrame.personalResourceFrame:Hide()\n    end\n    envTable.UpdateRessourcesAmount(unitFrame)\n    \n    --save the time of the last talent change\n    modTable.LastPlayerTalentUpdate = GetTime()\n    \nend\n\n\n\n\n",
					},
